import React, { useContext } from "react";
import { ApplicantContext } from "./ApplicantContext";

//GENERAL
import { TextField, Grid } from "@material-ui/core";

//USER PREFERENCES
export default props => {
  const [state] = useContext(ApplicantContext);
  const { user } = state;
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your email here'
          name='student_email_id'
          label='Email'
          value={user.student_email_id}
          type='email'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["email"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your phone here'
          name='student_mobile_number'
          label='Phone'
          value={user.student_mobile_number}
          type='tel'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_mobile_number"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your KCSE Grade here'
          name='kcse_grade'
          label='Kcse Grade'
          value={user.kcse_grade}
          type='text'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["kcse_grade"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Select your Category here'
          name='student_category'
          label='Student Category'
          value={user.student_category}
          type='text'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_category"]}
          required
          fullWidth
        />
      </Grid>
    </Grid>
  );
};
